webpackJsonp([24041335701291],{622:function(e,o){e.exports={data:{markdownRemark:{html:'<h2 id="tutorials-for-deploying-on-different-static-site-hosts"><a href="#tutorials-for-deploying-on-different-static-site-hosts" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Tutorials for deploying on different static site hosts</h2>\n<ul>\n<li><a href="/docs/deploy-gatsby/#amazon-s3-and-cloudfront">S3/Cloudfront</a></li>\n<li><a href="/docs/deploy-gatsby/#github-pages">Github Pages</a></li>\n</ul>\n<h2 id="amazon-s3-and-cloudfront"><a href="#amazon-s3-and-cloudfront" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Amazon S3 and Cloudfront</h2>\n<p>If you decide to host your Gatsby site on S3 with Cloudfront as CDN, you should change the “Origin Domain Name” on the Cloudfront panel with the real URL of your S3 bucket: <strong>examplewebsite.com.s3-website-eu-west-1.amazonaws.com</strong> replacing the default URL suggested by Amazon <strong>examplewebsite.com.s3.amazonaws.com</strong>.</p>\n<p>Without this change, <a href="https://forums.aws.amazon.com/message.jspa?messageID=314454">S3 doesn’t look for index.html files when serving “clean urls”</a>.</p>\n<h2 id="github-pages"><a href="#github-pages" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Github Pages</h2>\n<h3 id="deploying-a-project-page"><a href="#deploying-a-project-page" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Deploying a project page</h3>\n<p>You can deploy sites on Github Pages with or without a custom domain. If you choose to use the default setup (without a custom domain), you will need to setup your site with <a href="/docs/path-prefix/">path prefixing</a>.</p>\n<h3 id="use-the-npm-package-gh-pages-for-deploying"><a href="#use-the-npm-package-gh-pages-for-deploying" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Use the NPM package <code>gh-pages</code> for deploying</h3>\n<p>First add <strong>gh-pages</strong> as a <code>devDependency</code> of your site and create an npm script to <strong>deploy</strong> your project by running <code>npm install gh-pages --save-dev</code> or <code>yarn add gh-pages --dev</code> (if you have yarn installed).</p>\n<p>Then add a <code>deploy</code> script in your <code>package.json</code> file.</p>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>&quot;scripts&quot;: {\n  &quot;deploy&quot;: &quot;gatsby build --prefix-paths &amp;&amp; gh-pages -d public&quot;,\n}</code></pre>\n      </div>\n<p>In the <code>gatsby-config.js</code>, set the <code>pathPrefix</code> to be added to your site’s link paths. The <code>pathPrefix</code> should be the project name in your repository. (ex. <code>https://github.com/username/project-name</code> - your <code>pathPrefix</code> should be <code>/project-name</code>). See <a href="/docs/path-prefix/">the docs page on path prefixing for more</a>.</p>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>module.exports = {\n  pathPrefix: `/project-name`,\n}</code></pre>\n      </div>\n<p>Now run <code>yarn deploy</code> or <code>npm run deploy</code>. Preview changes in your github page <code>https://username.github.io/project-name/</code>. You can also find the link to your site on Github under <code>Settings</code> > <code>Github Pages</code>.</p>\n<h3 id="deploying-a-userorganization-site"><a href="#deploying-a-userorganization-site" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Deploying a user/organization site</h3>\n<p>Unlike project pages, user/organization sites on Github live in a special repository dedicated to files for the site. The sites must be published from the <code>master</code> branch of the repository which means the site source files should be kept in a branch named <code>source</code> or something similar. We also don’t need to prefix links like we do with project sites.</p>\n<p>The repository for these sites requires a special name. See <a href="https://help.github.com/articles/user-organization-and-project-pages/">https://help.github.com/articles/user-organization-and-project-pages/</a> for documentation on naming your site’s repository.</p>\n<p>Like with project sites, add <code>gh-pages</code> as a <code>devDependency</code> and add a <code>deploy</code> script to your site’s <code>package.json</code> file:</p>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>&quot;scripts&quot;: {\n  &quot;deploy&quot;: &quot;gatsby build &amp;&amp; gh-pages -d public --branch master&quot;,\n}</code></pre>\n      </div>\n<h2 id="debugging-tips"><a href="#debugging-tips" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Debugging tips</h2>\n<h3 id="dont-minify-html"><a href="#dont-minify-html" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Don’t minify HTML</h3>\n<p>If you see the following error:</p>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>Unable to find element with ID ##</code></pre>\n      </div>\n<p>or alternatively</p>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>Uncaught Error: Minified React error #32; visit http://facebook.github.io/react/docs/error-decoder.html?invariant=32&amp;args[]=## for the full message or use the non-minified dev environment for full errors and additional helpful warnings.</code></pre>\n      </div>\n<p>This is a new problem when dealing with static sites built with React. React uses HTML comments to help identify locations of components that do not render anything. If you are using a CDN that minifies your HTML, it will eliminate the HTML comments used by react to take control of the page on the client.</p>',excerpt:"Tutorials for deploying on different static site hosts S3/Cloudfront Github Pages Amazon S3 and Cloudfront If you decide to host your Gatsby…",timeToRead:3,frontmatter:{title:"Deploying Gatsby"},parent:{__typename:"File",relativePath:"docs/deploy-gatsby.md"}}},pathContext:{slug:"/docs/deploy-gatsby/"}}}});
